import React from "react";
import Header from "../Components/Header/Header";
import Sidebar from "../Components/Sidebar/Sidebar";
import Banner from "../Components/Banner/Banner";

function Home() {
  return (
    <div>
      <Header />
      <Sidebar />
      <Banner />
    </div>
  );
}

export default Home;
